import React from 'react';
import logo from './logo.svg';
import './App.css';
import Signup from './Signup';
import Login from './Login';
import Search from './Search';
import Recipe from './Recipe';
import Pantry from './Pantry';
import Favorite from './Favorite';
import Restriction from './Restriction';
import Menu from './Menu';
import { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import { tsConstructorType } from '@babel/types';
import Rootstore from './Rootstore';


class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };
      }

  render (){
      return(
    <div className="Main">
      <Menu/>
      <Switch>
      <Route path='/signup' render={(props)=><Signup {...props} store = {this.props.store.Instance()}/>} />      
      <Route path='/login' render={(props)=><Login {...props} store = {this.props.storeInstance()}/>} />
      <Route path='/search' render={(props)=><Search {...props} store = {this.props.store}/>} />
      <Route path='/recipe' render={(props)=><Recipe {...props} store = {this.props.store}/>} />
      <Route path='/pantry' render={(props)=><Pantry {...props} store = {this.props.store}/>} />
      <Route path='/favorite' render={(props)=><Favorite {...props} store = {this.props.store}/>}/>
      <Route path='/restrictions' render={(props)=><Restriction {...props} store = {this.props.store}/>} />
      </Switch>






    </div>
      )};
}

export default Main;
